import { wineOne } from "../Data/wine_data.js";
import "./Layout//wineDisplay.css";

export default function wineDisplay() {
  return (
    <div class card>
      <h1>{wineOne.name}</h1>
      <img
        src="https://cdn.klwines.com/images/skus/1540775x.jpg"
        alt="HTML code."
        class="img-fluid img-center img-round img-featured"
        data-v-0f11a864=""
      />
      <p class="price">${wineOne.price}</p>
      <li>
        <ul>Type: {wineOne.type}</ul>
        <ul>Region: {wineOne.region}</ul>
      </li>
      <p>
        <button>More Information</button>
      </p>
    </div>
  );
}
